import React, { useState } from 'react';

const Login = ({ onLogin }) => {
  const [credentials, setCredentials] = useState({
    email: '',
    password: ''
  });
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (field, value) => {
    setCredentials(prev => ({
      ...prev,
      [field]: value
    }));
    setError('');
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError('');

    try {
      await new Promise(resolve => setTimeout(resolve, 1000));

      if (credentials.email === 'demo@hayguard.com' && credentials.password === 'demo123') {
        const result = await onLogin(credentials.email, credentials.password);
        if (!result.success) {
          setError(result.error);
        }
      } else {
        setError('Invalid email or password. Use demo@hayguard.com / demo123 for demo access.');
      }
    } catch (err) {
      setError('Login failed. Please try again.');
    } finally {
      setIsLoading(false);
    }
  };

  const handleDemoLogin = () => {
    setCredentials({
      email: 'demo@hayguard.com',
      password: 'demo123'
    });
  };

  return (
    <div style={{ minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', padding: '20px' }}>
      <div style={{ background: 'white', padding: '48px', borderRadius: '16px', boxShadow: '0 20px 25px -5px rgba(0, 0, 0, 0.1)', width: '100%', maxWidth: '450px', margin: '0 auto' }}>
        <div style={{ textAlign: 'center', marginBottom: '32px' }}>
          <img src="/logo.png" alt="HayGuard" style={{ height: '60px', marginBottom: '16px' }} />
          <h1 style={{ margin: '0', fontSize: '28px', fontWeight: '700', color: '#111827', marginBottom: '8px' }}>Welcome to HayGuard</h1>
          <p style={{ margin: '0', color: '#6b7280', fontSize: '16px' }}>Sign in to your farm monitoring dashboard</p>
        </div>

        <div style={{ background: '#eff6ff', border: '1px solid #bfdbfe', borderRadius: '8px', padding: '16px', marginBottom: '24px' }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px', marginBottom: '8px' }}>
            <span style={{ fontSize: '20px' }}>ðŸŽ¯</span>
            <h3 style={{ margin: '0', color: '#1e40af', fontSize: '14px', fontWeight: '600' }}>Demo Access</h3>
          </div>
          <p style={{ margin: '0 0 12px 0', fontSize: '14px', color: '#1e40af' }}>Use these credentials to explore the dashboard:</p>
          <div style={{ background: 'white', padding: '12px', borderRadius: '6px', fontSize: '14px', fontFamily: 'monospace', color: '#374151' }}>
            <div><strong>Email:</strong> demo@hayguard.com</div>
            <div><strong>Password:</strong> demo123</div>
          </div>
          <button onClick={handleDemoLogin} style={{ background: '#3b82f6', color: 'white', border: 'none', padding: '8px 16px', borderRadius: '6px', fontSize: '12px', fontWeight: '500', cursor: 'pointer', marginTop: '12px', width: '100%' }}>Fill Demo Credentials</button>
        </div>

        <form onSubmit={handleSubmit}>
          {error && (
            <div style={{ background: '#fef2f2', border: '1px solid #fecaca', color: '#dc2626', padding: '12px', borderRadius: '8px', marginBottom: '20px', fontSize: '14px' }}>{error}</div>
          )}

          <div style={{ marginBottom: '20px' }}>
            <label style={{ display: 'block', marginBottom: '8px', fontWeight: '600', color: '#374151', fontSize: '14px' }}>Email Address</label>
            <input type="email" value={credentials.email} onChange={(e) => handleInputChange('email', e.target.value)} placeholder="Enter your email" required style={{ width: '100%', padding: '12px', border: '1px solid #d1d5db', borderRadius: '8px', fontSize: '16px', outline: 'none', boxSizing: 'border-box' }} />
          </div>

          <div style={{ marginBottom: '24px' }}>
            <label style={{ display: 'block', marginBottom: '8px', fontWeight: '600', color: '#374151', fontSize: '14px' }}>Password</label>
            <input type="password" value={credentials.password} onChange={(e) => handleInputChange('password', e.target.value)} placeholder="Enter your password" required style={{ width: '100%', padding: '12px', border: '1px solid #d1d5db', borderRadius: '8px', fontSize: '16px', outline: 'none', boxSizing: 'border-box' }} />
          </div>

          <button type="submit" disabled={isLoading || !credentials.email || !credentials.password} style={{ width: '100%', background: isLoading || !credentials.email || !credentials.password ? '#9ca3af' : '#10b981', color: 'white', padding: '14px', border: 'none', borderRadius: '8px', fontSize: '16px', fontWeight: '600', cursor: isLoading || !credentials.email || !credentials.password ? 'not-allowed' : 'pointer' }}>
            {isLoading ? 'Signing In...' : 'Sign In to Dashboard'}
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
